    /**
     * mixcotag召回
     * @param ucombinetag
     * @param weight   判定新兴趣阈值，小于该阈值走强插逻辑
     * @param featureExposeClickMap session内用户正负反馈信息
     * @return
     */
    public static Map<String,RecallCate> ContentBasedRecall(String ucombinetag, Double weight,  Map<String, FeatureExposeClick> featureExposeClickMap, Map<String,RecallCate> recallcateMap){

        //解析ucombinetag画像
        JSONArray cotagarray = JSONObject.parseArray(ucombinetag);

        for(Object obj:cotagarray){
            Cotag cotag = JSON.parseObject(JSON.toJSONString(obj),Cotag.class);
            //遍历每个cotag，更新召回策略Map
                String n = cotag.n;
                String s = cotag.s;
                String e = cotag.e;
                String c = cotag.c;
                String cate = null;
                //过滤部分cotag
                if(n != null && s !=null && Double.parseDouble(s)>0.5 && (Double.parseDouble(c)==1 && Double.parseDouble(c)/Double.parseDouble(e)>0.12
                || Double.parseDouble(c)>1)){
                    //获取cate，更新/生成召回策略
                    String[] arr = n.split("-");
                    cate = arr[0];
                    RecallCate recallcate = null;
//                    System.out.println(JSON.toJSONString(cotag));
                    //判断cate及subcate，一个大类曝光>=6,ctr<0.1不进行召回
                    String key = "cate_"+n;
                    if(featureExposeClickMap.containsKey(key)){
                        FeatureExposeClick featureExposeClick = featureExposeClickMap.get(key);
                        Double click = featureExposeClick.getClick();
                        Double expose = featureExposeClick.getExpose();
                        Double ctr = click / expose;
                        if(expose>=6 && ctr<0.1){
                            continue;
                        }
                    }
                    //判断topic，一个topic曝光>=4，ctr<1/4不进行召回
                    key = "topic_"+n;
                    if(featureExposeClickMap.containsKey(key)){
                        FeatureExposeClick featureExposeClick = featureExposeClickMap.get(key);
                        Double click = featureExposeClick.getClick();
                        Double expose = featureExposeClick.getExpose();
                        Double ctr = click / expose;
                        if(expose>=4 && ctr<0.1){
                            continue;
                        }
                    }
                    //判断cotag，一个cotag曝光>=3,ctr<1/2不进行召回
                    key = "cotag_"+n;
                    if(featureExposeClickMap.containsKey(key)){
                        FeatureExposeClick featureExposeClick = featureExposeClickMap.get(key);
                        Double click = featureExposeClick.getClick();
                        Double expose = featureExposeClick.getExpose();
                        Double ctr = click / expose;
                        if(expose>=3 && ctr<0.2){
                            continue;
                        }
                    }

                    //非新大类处理
                    if(recallcateMap != null && recallcateMap.containsKey(cate)){
                        recallcate  = recallcateMap.get(cate);
                        List<String>  recalltags = recallcate.getRecalltags();
                        List<String>  weights = recallcate.getWeights();
                        int ev = recallcate.getE();
                        int pv = recallcate.getC();
                        if(recalltags == null){
                            recalltags = new ArrayList<>();
                        }
                        if(weights == null){
                            weights = new ArrayList<>();
                        }
                        recalltags.add(n);
                        weights.add(s);
                        ev += Integer.parseInt(e);
                        pv += Integer.parseInt(c);
                        recallcate.setRecalltags(recalltags);
                        recallcate.setWeights(weights);
                        recallcate.setE(ev);
                        recallcate.setC(pv);
                    }else{//新大类处理
                        recallcate  = new RecallCate();
                        List<String> recalltags = new ArrayList<>();
                        List<String> weights = new ArrayList<>();
                        recalltags.add(n);
                        weights.add(s);
                        recallcate.setRecalltags(recalltags);
                        recallcate.setWeights(weights);
                        recallcate.setE(Integer.parseInt(e));
                        recallcate.setC(Integer.parseInt(c));
                        recallcate.setCate(cate);
                        recallcateMap.put(cate,recallcate);
                    }
//                    System.out.println("1n:"+n+",recalltags:"+recallcateMap.get(cate).getRecalltags());
                }
        }
        for(Map.Entry<String, RecallCate> entry : recallcateMap.entrySet()){
            String key = entry.getKey();
            RecallCate recallCate = entry.getValue();
            String weight1 = recallCate.getWeights().get(0);
            int num = recallCate.getRecalltags().size();
            int ev = recallCate.getE();
            int pv = recallCate.getC();
            Double score = Math.log(Double.parseDouble(weight1)+0.55)*Math.log(num+50)*Math.log(1.0*pv/num+5);
            recallCate.setScore(score);
            System.out.println(key+":"+weight1+":"+num+":"+ev+":"+pv+"："+score);
            //最终按score占所有score比例计算召回量
        }


        return recallcateMap;
    }

